import React from "react";
import "./style.css";

const Temp = () => {
  return (
    <>
      <div className="wrap">
        <div className="search">
          <input
            type="search"
            placeholder="Search..."
            id="search"
            autoFocus
            className="searchTerm"
          />
          <button className="searchButton" type="b"></button>
        </div>
      </div>
    </>
  );
};

export default Temp;
